import { styled } from "styled-components";

const Wrapper=styled.div`
background-color:black;
ul{
    display:flex;
    list-style:none;
    justify-content:space-around;
    li{
       
        a{
            text-decoration:none;
            font-size:20px;
            color:black;
            &:hover{
                color:grey;
                text-decoration:underline;
            }
        }
       
        
    }
}
`
export default Wrapper;
